import React, {Component} from 'react';
import './Mint.css';
import number from '../pics/number.gif';

//#fdeb37

class Mint extends Component {
  render() {
    return (
      <div>
        <div className="wrapper"> 
          <h1> HOW BIG IS YOUR PEE PEE</h1>
          <h2> Size don't matter homies.</h2>
          <div className="mint-wrapper">
            <img className="number" src={number}/>
            <div className="mint inner">
              <p className="description"> How Big is My Pee Pee is a collection of 1500 randomly generated pee pee lengths stored on chain. </p>
            </div>
          </div>
        </div>
        <div className="rarity">

        </div>
      </div>
    );
  }
}

export default Mint;
